svg.script:


document.addEventListener('DOMContentLoaded', function(event) {
  const icons = document.children[0].getElementsByTagName("svg");
  const pad = 0;  //2
  let x = 0;
  let y = 0;
  let rowh = 0;
  let prevClass = "";
  for (let i = 0; i < icons.length; i++) {
    const cls = icons[i].getAttribute("class");
    const w = icons[i].width.baseVal.value + pad;
    const h = icons[i].height.baseVal.value + pad;
    if(cls != prevClass) {
      if(x > 0) { x = 0; y += rowh; rowh = 0; }
      prevClass = cls;
    }
    icons[i].setAttribute("x", x+"px");
    icons[i].setAttribute("y", y+"px");
    x += w;
    rowh = Math.max(rowh, h);
    if(x >= 640) { x = 0; y += rowh; rowh = 0; }
  }
  document.children[0].classList.add("preview");
});
